import React, { useState } from "react";

const ClearAllTodos = ({addTodo}) => {
  const [jopa, setUnderLine] = useState();

  const line = () => {addTodo({jopa})};

  return (
    <div className="text-white text-4xl text-center">
      <input type="text" onChange={setUnderLine} value={jopa} color />
      <br />
      <button onClick={line}>start</button>
    </div>
  );
};

export default ClearAllTodos;
